// const data = [
// { date:"08/01/2021", donated_to: "GOVERNMENT HOSPITAL, GOBICHETTIPALAYAM, ERODE", no:"41 UNITS",photo:"https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg"},
// ]

import axios from 'axios';
import React,{useState,useEffect} from 'react';

const Blood=()=>{

const [data,setdata]=useState([]);
useEffect(()=>{
	const res=async()=>{
		const {out}=await axios.get("http://127.0.0.1:8000/api/bdc/")
		setdata(out);
	}
	res()
},[]);
console.log(data)





return (
	<div  className="card">
	<div className="App">
	<table>
		<tr>
		<th >DATE</th>
		<th >DONATED TO</th>
		<th >NO OF UNITS</th>
        <th >PHOTO</th>
		</tr>
		{data.map((val, key) => {
		return (
			<tr key={key}>
				<td >{val.date}</td>
				<td >{val.donated_to}</td>
				<td >{val.no}</td>
				<td ><img src={val.photo} alt="null" height="160px" width="200px" /></td>
			</tr>
		)
		})}
	</table>
	</div>
	</div>
);
}

export default Blood;
